const TodoItem = ({
                      todo = {
                          done: true, title: 'Buy milk', status: 'COMPLETED'
                      }
                  }) => {
    return (
        <div>

            <h2>TodoItem</h2>
            <li>
                <input type="checkbox"
                       defaultChecked={todo.done}/>
                {todo.title}
                ({todo.status})
            </li>
        </div>
    );
}
export default TodoItem;
